description:
&quot;Experiment gone awry&quot;

Brad Anderson, Jonas Pate                              January 23, 2006


After it's revealed to Laura that a cadre of top scientists created this new species, she wakes up in a field after being drugged and Rich comes to her rescue. Fearing the end of the world, Laura and Rich are determined to find the mysterious corporation that funded this experiment gone awry, but nothing could prepare them for what they discover in an abandoned laboratory along the way. Meanwhile, Miles joins Bloom and his crew of aquarium workers on a boat excursion to find the egg field containing millions of unhatched creatures. Surprisingly, Miles later agrees to help law enforcement find Nim.
